import styled from 'styled-components';
import Buttons from '../atoms/button';
import React from 'react';

const ActionButton = styled.div`
    display: flex;
`;

const ActionButtons = (props) => {

    return(
    <ActionButton>
        <Buttons color="white" background="rgb(66, 195, 96)" border-bottom="2px solid rgb(40, 167, 69)" onClick={props.open} hover_back="rgb(40, 167, 69)" hover_border="2px solid rgb(32, 132, 55)">New</Buttons>
        <Buttons color="white" background="rgb(215, 58, 73)" border-bottom="2px solid rgb(175, 28, 42)" onClick={props.delete} hover_back={props.hover_back} hover_border={props.hover_border}>Delete</Buttons>
    </ActionButton>
    )
}

  export default ActionButtons;
